"use strict";(self.webpackChunkrhdtl_78_github_io=self.webpackChunkrhdtl_78_github_io||[]).push([[866],{4612:function(n){n.exports=JSON.parse('{"blogPosts":[{"id":"/blog/review/macbook-m1-pro","metadata":{"permalink":"/blog/blog/review/macbook-m1-pro","source":"@site/blog/2021-03-01-review-macbook-pro-m1.md","title":"\uac1c\ubc1c\uc790\ub85c\uc11c\uc758 M1 \ub9e5\ubd81 \ub9ac\ubdf0","description":"\uc804\uc131\ube44 \uae61\ud328\uc758 M1, \ud558\uc9c0\ub9cc \ud504\ub85c?","date":"2021-03-01T00:00:00.000Z","formattedDate":"March 1, 2021","tags":[{"label":"Review","permalink":"/blog/tags/review"},{"label":"Macbook Pro","permalink":"/blog/tags/macbook-pro"},{"label":"M1","permalink":"/blog/tags/m-1"}],"readingTime":3.465,"truncated":true,"authors":[{"name":"Jeonghun Kong","title":"Full stack developer","url":"https://github.com/rhdtl78","imageURL":"https://github.com/rhdtl78.png","key":"rhdtl78"}],"nextItem":{"title":"\uc560\ud50c \uc6cc\uce58 \uc2dc\ub9ac\uc9886 \ub9ac\ubdf0","permalink":"/blog/blog/review/apple-watch-series-6"}},"content":"![\uc2e4 \uc0ac\uc6a9](./macbook-pro-m1-13/m1-macbook-pro-13-real.png)\\n\x3c!--truncate--\x3e\\n## \ub514\uc790\uc778\\n![\uce21\uba74](https://store.storeimages.cdn-apple.com/8756/as-images.apple.com/is/mbp-spacegray-gallery1-202011?wid=2000&hei=1536&fmt=jpeg&qlt=95&.v=1632937794000)\\n![\ubcf8\uccb4](https://store.storeimages.cdn-apple.com/8756/as-images.apple.com/is/mbp-spacegray-gallery2-202011_GEO_KR?wid=2000&hei=1536&fmt=jpeg&qlt=95&.v=1632941112000)\\n![\uc591\uce21\uba74](https://store.storeimages.cdn-apple.com/8756/as-images.apple.com/is/mbp-spacegray-gallery3-202011?wid=2000&hei=1536&fmt=jpeg&qlt=95&.v=1603475918000)\\n![\uc0c1\ud310](https://store.storeimages.cdn-apple.com/8756/as-images.apple.com/is/mbp-spacegray-gallery4-202011?wid=2000&hei=1536&fmt=jpeg&qlt=95&.v=1603475931000)\\n\\n__\uc790\ub8cc\ucd9c\ucc98: [\uc560\ud50c \uacf5\uc2dd \ud648\ud398\uc774\uc9c0](https://www.apple.com/kr/shop/buy-mac/macbook-pro/13\ud615-\uc2a4\ud398\uc774\uc2a4-\uadf8\ub808\uc774-apple-m1-\uce69(8\ucf54\uc5b4-cpu-\ubc0f-8\ucf54\uc5b4-gpu)-512gb#)__\\n\\n\\n## \uc131\ub2a5\\n\uc804 \uc138\ub300 \ubcf4\ub2e4 \ud604\uc800\ud558\uac8c \ub0ae\uc740 \ubc1c\uc5f4 \ub355\uc5d0 \uc2a4\ub85c\ud2c0\uc744 \uacbd\ud5d8\ud558\uae30 \ud798\ub4e4\ub2e4.  m1 \ub124\uc774\ud2f0\ube0c\ud558\uac8c \ube4c\ub4dc\ud658\uacbd\uc744 \uad6c\uc131\ud558\uba74 \uc18c\uc694 \uc0ac\uac04 \ucc28\uc774\ub97c \ud655\uc2e4\ud558\uac8c \ub290\ub084 \uc218 \uc788\ub2e4.\\n\\nxcode \uc544\uce74\uc774\ube0c \uc815\ub3c4\ub294 \ub418\uc5b4\uc57c \ud32c\uc774 \ub3cc\uc544\uac04\ub2e4.  \uc774\ub54c CPU \ubaa8\ub2c8\ud130 \uc0c1\uc73c\ub85c \ucd5c\uace0 \uc628\ub3c4\ub294 100\ub3c4 \uac00\uae4c\uc774 \uc62c\ub77c\uac00\uc9c0\ub9cc \uc5f4 \ud328\ud0a4\uc9d5\uc774 \uc798 \ub418\uc5c8\ub294\uc9c0 \ud31c\ub808\uc2a4\ud2b8\ub098 \ud558\uc6b0\uc9d5\uc73c\ub85c \uc804\ub2ec\ub418\uc9c0 \uc54a\ub294\uac83 \uac19\ub2e4. \uc0c1\ub2f9\ud788 \ucf8c\uc801\ud558\ub2e4.\\n\\nm1 \uc744 \ub124\uc774\ud2f0\ube0c\ud558\uac8c \uc9c0\uc6d0\ud558\ub294 \ud504\ub85c\uadf8\ub7a8\ub4e4\uc740 \ud655\uc2e4\ud788 \ub180\ub77c\uc6b8 \uc815\ub3c4\uc758 \ud37c\ud3ec\uba3c\uc2a4\ub97c \ubcf4\uc778\ub2e4. \uac70\uc758 \ub300\uae30 \uc2dc\uac04\uc774 \uc5c6\uac70\ub098, \uc804\uc138\ub300\uc5d0 \ube44\ud574 \ub208\uc5d0 \ub744\ub294 \ucc28\uc774\ub97c \ubcf4\uc778\ub2e4.\\n\\n![\ubca4\uce58\ub9c8\ud06c \ube44\uad50](./macbook-pro-m1-13/m1-macbook-pro-13-geekbench.png)\\n__\uc790\ub8cc\ucd9c\ucc98: [Geekbench](https://browser.geekbench.com/v5/cpu/search?utf8=\u2713&q=MacBook+Pro+13)__\\n\\n## \ud638\ud658\uc131\\nRN \uc744 \uc0ac\uc6a9\ud55c \uac1c\ubc1c \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c\ub294 JDK\ub97c Zulu-11-ARM64 \ub97c \uc0ac\uc6a9\ud558\uba74 node-gradle-plugin\uc774 \uc624\ub3d9\uc791\ud558\ub294 \ubb38\uc81c\uac00 \ubc1c\uc0dd\ud588\ub2e4.\\n[\uad00\ub828 \uc774\uc288 \ub9c1\ud06c](https://github.com/node-gradle/gradle-node-plugin/issues/152)\\n\\n\ub9ce\uc740 \uba54\uc774\uc800 \uc18c\ud504\ud2b8\uc6e8\uc5b4 \uc81c\uacf5\uc790\ub4e4\uc740 \ubc1c\ube60\ub974\uac8c M1 \ub300\uc751 \ube4c\ub4dc\ub97c \ub0b4\ub193\uace0 \uc788\uc9c0\ub9cc, \uc544\uc9c1 \ubd88\uc548\uc815 \ud55c \uac83\uc740 \uc0ac\uc2e4\uc774\ub2e4.\\n\\n### Rosetta\\n* Cocoapods\\n    * ffi \uad00\ub828 \uc774\uc288\uac00 \uc788\ub2e4.  Rosetta \ud658\uacbd\uc5d0\uc11c \uc124\uce58 \ubc0f ffi \ub97c \uc124\uce58\ud574 \ud574\uacb0 \uac00\ub2a5\ud558\uc9c0\ub9cc \uc5b4\ub514\uae4c\uc9c0\ub098 Rosetta \uc704\uc5d0\uc11c \ub3d9\uc791\ud558\uae30 \ub54c\ubb38\uc5d0 \uc131\ub2a5 \uc774\uc810\uc744 \ubcfc\uc218 \uc5c6\uc5c8\ub2e4.\\n* iOS Simulator target build\\n    * xcode\uc758 \uacbd\uc6b0 3rd-party library  \uc5c6\uc774 \uac1c\ubc1c\ud55c\ub2e4\uba74 \ubb38\uc81c\uc5c6\uaca0\uc9c0\ub9cc, Cocoapod\uc744 \uc0ac\uc6a9\ud55c\ub2e4\uba74 Cocoapod \ub9cc\uc774\ub77c\ub3c4 Rosetta\ub85c \uc2e4\ud589\ud574\uc57c\ud55c\ub2e4. \ub9cc\uc57d \ub300\uc0c1 \ub77c\uc774\ube0c\ub7ec\ub9ac\uac00 \uc544\uc9c1 \uc81c\ub300\ub85c\ub41c m1 \ud658\uacbd\uc744 \ub300\uc751\ud558\uc9c0 \uc54a\uc558\ub2e4\uba74 Simulator \ub300\uc0c1 \ube4c\ub4dc\uac00 \ubd88\uac00\ud558\ub2e4. \uc774 \uacbd\uc6b0 Xcode\ub97c \ud1b5\uc73c\ub85c Rosetta\ub85c \uc2e4\ud589\ud558\uba74 \ud574\uacb0\uac00\ub2a5\ud558\ub2e4.\\n* \uae30\ud0c0 \uc571\\n    * \uc775\uc219\ud558\uac8c \uc0ac\uc6a9\ud574\uc624\ub358 \uc571\ub4e4\uc774 \uc544\uc9c1 M1 \ub300\uc751\uc774 \uc548\ub418\uc5c8\ub2e4\uba74, \uc131\ub2a5 \uc790\uc6d0\uc744 \uc7a1\uc5b4\uba39\ub294 \uad34\ubb3c\ub4e4\uc774\ub41c\ub2e4. \uc704\uc5d0\uc11c \uc5b8\uae09\ud55c Rider\uc640  Unity\ub294 \uc544\uc9c1 Apple Silicon \ub300\uc751 \ubc84\uc804\uc744 \uc0ac\uc6a9\ud558\uc9c0 \ubabb\ud558\uace0 \uc788\ub2e4. \ubc84\uadf8\uc778\uc9c0 Intellij, Rider, Unity\ub97c \ud568\uaed8 \ub744\uc6cc\ub450\uace0 Intellij\ub9cc \uc0ac\uc6a9\ud558\uace0 \uc788\uc5c8\ub294\ub370 \uba54\ubaa8\ub9ac \ubd80\uc871 \uacbd\uace0\ub97c \ubc1b\uc558\ub2e4. \ud655\uc778\ud574\ubcf4\ub2c8 Unity\uc640 Rider\uac00 \ud569\uccd0 7GB \uc774\uc0c1\uc758 \uba54\ubaa8\ub9ac\ub97c \uc7a1\uc544\uba39\uace0 \uc788\uc5c8\ub2e4.\\n    * \uc74c\uc545, \ud3b8\uc9d1 \uad00\ub828 \uc5c5\uacc4\uc5d0\uc11c\ub3c4 \ud50c\ub7ec\uadf8\uc778 \ubbf8\uc9c0\uc6d0 \uc0ac\ub840\uac00 \uc9c0\uc18d\uc801\uc73c\ub85c \ubcf4\uc774\uace0 \uc788\ub2e4. \\n\\n\\nimport CoupangPartners from \'@site/src/components/coupang-partners\'\\n\\n<CoupangPartners\\n  adID=\\"527409\\"\\n  template=\\"carousel\\"\\n  trackingCode=\\"AF8809335\\"\\n  width={680}\\n  height={140}\\n/>"},{"id":"/blog/review/apple-watch-series-6","metadata":{"permalink":"/blog/blog/review/apple-watch-series-6","source":"@site/blog/2021-01-12-review-apple-watch-series-6.md","title":"\uc560\ud50c \uc6cc\uce58 \uc2dc\ub9ac\uc9886 \ub9ac\ubdf0","description":"\uc560\ud50c \uc6cc\uce58 \uc2dc\ub9ac\uc9886 \ub9ac\ubdf0","date":"2021-01-12T00:00:00.000Z","formattedDate":"January 12, 2021","tags":[{"label":"Review","permalink":"/blog/tags/review"},{"label":"Apple","permalink":"/blog/tags/apple"},{"label":"Apple Watch Series 6","permalink":"/blog/tags/apple-watch-series-6"},{"label":"\uc560\ud50c \uc6cc\uce58","permalink":"/blog/tags/\uc560\ud50c-\uc6cc\uce58"},{"label":"\uc560\ud50c \uc6cc\uce58 6","permalink":"/blog/tags/\uc560\ud50c-\uc6cc\uce58-6"},{"label":"\uc560\ud50c \uc6cc\uce58 \uc2dc\ub9ac\uc988 6","permalink":"/blog/tags/\uc560\ud50c-\uc6cc\uce58-\uc2dc\ub9ac\uc988-6"}],"readingTime":8.86,"truncated":true,"authors":[{"name":"Jeonghun Kong","title":"Full stack developer","url":"https://github.com/rhdtl78","imageURL":"https://github.com/rhdtl78.png","key":"rhdtl78"}],"prevItem":{"title":"\uac1c\ubc1c\uc790\ub85c\uc11c\uc758 M1 \ub9e5\ubd81 \ub9ac\ubdf0","permalink":"/blog/blog/review/macbook-m1-pro"},"nextItem":{"title":"\uc544\uc774\ud328\ub4dc \ud504\ub85c 2\uc138\ub300 \ub9ac\ubdf0","permalink":"/blog/blog/review/ipad-pro-gen2"}},"content":"![\ub300\ud45c \uc0ac\uc9c4 - \uc560\ud50c \uc6cc\uce58 \uc2dc\ub9ac\uc988 6 40mm](./apple-watch-serise-6/IMG_0129.jpeg)\\n\x3c!--truncate--\x3e\\n### \uccab \uc2a4\ub9c8\ud2b8 \uc6cc\uce58\\n\ub098\uc758 \uccab \uc2a4\ub9c8\ud2b8 \uc6cc\uce58\ub294 Galaxy Gear3\ub2e4. \ud68c\uc0ac\uc5d0 \uc788\ub358 \ud14c\uc2a4\ud2b8 \uae30\uae30\ub97c \uc77c\uc8fc\uac04 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc5c8\ub2e4. \uc2a4\ub9c8\ud2b8 \uc6cc\uce58\uc5d0 \ub300\ud574 IT \ub274\uc2a4 \ubc0f \uc18c\uc2dd \uae00 \ub4f1\uc73c\ub85c \ucd9c\uc2dc \ub4f1\uc740 \uc54c\uace0 \uc788\uc5c8\ub2e4.  \\n\uadf8\ub7ec\ub098 \uac00\uaca9\uc774 \uc81c\ubc95 \ub098\uac00\uae30 \ub54c\ubb38\uc5d0 \uc120\ub73b \uad6c\ub9e4 \uc695\uad6c\ub294 \uc77c\uc5b4\ub098\uc9c0 \uc54a\uc558\uc5c8\uace0 \uc0ac\uc11c \uc774\uac78\ub85c \ubb34\uc5c7\uc744 \ud560\uae4c \uc0dd\uac01\uc774 \ub4e4\uc5c8\ub2e4.  \\n\\n\ud558\uc9c0\ub9cc \uc9c1\uc811 \uc0ac\uc6a9\ud574\ubcf4\ub2c8 \uc0dd\uac01\uc774 180\ub3c4 \ubc14\ub00c\uc5c8\ub2e4. \ub2f9\uc2dc \uc0ac\uc6a9\ud588\ub358 \uc2a4\ub9c8\ud2b8\ud3f0\uc740 \uac24\ub7ed\uc2dc S10+ 5G\ub85c Gear S3\ub97c \uc0ac\uc6a9\ud558\uae30 \ub531 \uc88b\uc558\ub2e4.  \\n\uc2a4\ub9c8\ud2b8\ud3f0\uacfc \uc5f0\ub3d9\ud574\ub450\uba74 \uc790\ub3d9\uc73c\ub85c \ub0b4 \ud65c\ub3d9\uc774 \ubaa8\ub2c8\ud130\ub9c1 \ub418\uc5b4 \ub0b4\uac00 \uc5bc\ub9c8\ub098 \uc6c0\uc9c1\uc600\ub294\uc9c0 (\uc6c0\uc9c1\uc774\uc9c0 \uc54a\uc558\ub294\uc9c0)\uc54c \uc218 \uc788\uc5c8\uace0, \uc0bc\uc131 \uc870\ud569\uc758 \ucd5c\ub300 \uc7a5\uc810\uc778 \uc0bc\uc131 \ud398\uc774\ub3c4 \uc190\ubaa9\uc73c\ub85c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc5c8\ub2e4. \\n\\n\uc81c\ubc95 \ud3b8\ub9ac\ud55c \uae30\ub2a5 \ub355\uc5d0 \ub9c8\uc74c\uc774 \ub9ce\uc774 \uc774\ub04c\ub838\uc73c\ub098 \ucc29\uc6a9\uac10\uc774 \uc0c1\ub2f9\ud788 \ud070 \uac78\ub9bc\ub3cc\ub85c \ub2e4\uac00\uc654\ub2e4. \ubc14\ub514\uac00 \uc0dd\uac01 \ubcf4\ub2e4 \ub450\uaebc\uc6cc \uc190\ubaa9\uc744 \ud0c0\uc774\ud2b8\ud558\uac8c \uc870\uc774\uc9c0 \uc54a\uc73c\uba74 \uc0c1\ub2f9\ud788 \ub9ce\uc774 \ud754\ub4e4\ub838\uace0 \uc2a4\ud2b8\ub7a9\ub3c4 \uadf8\ub9cc\ud07c \ub450\uaebc\uc6e0\ub2e4.  \\n\uae30\uc885\uc774 \uc624\ub798\uc804\uc5d0 \ucd9c\uc2dc\ud588\ub358 \ubaa8\ub378\uc778 \ud0d3\uc784\ub3c4 \uc788\uc9c0\ub9cc \uc774\ub807\uac8c \ubb34\uac81\uace0 \uac70\uc2ac\ub9ac\ub294\uac83\uc744 \uacc4\uc18d \ucc28\uace0\ub2e4\ub2c8\uae30\uc5d0\ub294 \ubb34\ub9ac\uac00 \uc788\uc744 \uac83 \uac19\ub2e4\uace0 \uc0dd\uac01\ud588\ub2e4. \ub610\ud55c \ud558\ub8e8\ub97c \uaca8\uc6b0 \ubc84\ud168\uc8fc\ub294 \ubc30\ud130\ub9ac\ub3c4 \uad6c\ub9e4\uc758\uc695\uc744 \uaebd\ub294 \uc6d0\uc778\uc911 \ud558\ub098\uc600\ub2e4.  \\n\uc0ac\uc6a9\ud588\ub358 \uae30\uae30\ub294 \ud14c\uc2a4\ud2b8 \uae30\uae30\uc5ec\uc11c \uc81c\ub300\ub85c \uad00\ub9ac\ub418\uc9c0 \uc54a\uc544 \ud558\ub8e8\ub294 \ucee4\ub155 \ubc18\ub098\uc808\ub3c4 \uac00\uc9c0 \ubabb\ud588\ub2e4. \uc815\uc0c1\uc801\uc778 \ubc30\ud130\ub9ac \uc218\uba85\uc5d0 \uc77c\ubc18\uc801\uc778 \uc0ac\uc6a9 \ud328\ud134\uc774\ub77c\uba74 \ud558\ub8e8 \uc870\uae08 \uc548\ub418\uac8c \ubc84\ud2f4\ub2e4\uace0 \ud55c\ub2e4. \\n\\n### \uad6c\ub9e4 \uacb0\uc815\\n\uadf8\ub807\uac8c \uc2dc\uac04\uc774 \uc9c0\ub098 \uc2a4\ub9c8\ud2b8\ud3f0\uc744 \uc544\uc774\ud3f0 11\ub85c \ubc14\uafb8\uba74\uc11c \uc560\ud50c \uc6cc\uce58\ub97c \uad6c\ub9e4\ud558\uac8c \ub418\uc5c8\ub2e4. \uad6c\ub9e4 \ubaa9\uc801\uc740 \ud65c\ub3d9 \ubaa8\ub2c8\ud130\ub9c1\uc774 \uc81c\uc77c \ucef8\ub2e4. \uae30\uc5b4\ub97c \uc0ac\uc6a9\ud588\uc744\ub54c \uac77\uae30\ub098 \ub6f0\uae30 \ubaa8\ub2c8\ud130\ub9c1\uc740 \ud070 \uac10\ub3d9\uc73c\ub85c \ub2e4\uac00\uc654\uc5c8\ub2e4.  \\n\uc190\ubaa9\uc5d0\uc11c \uc9c0\uc18d\uc801\uc73c\ub85c \uc6b8\ub824\uc8fc\ub2c8 \uc6c0\uc9c1\uc774\ub294\ub370 \uac00\ubcbc\uc6b4 \ub3d9\uae30\ubd80\uc5ec\ub3c4 \ub418\uc5c8\uace0 \ub0b4\uac00 \uc5bc\ub9c8\ub098 \uc6c0\uc9c1\uc600\ub294\uc9c0 \ud3f0\uc5d0\uc11c \ud655\uc778\ud560 \uc218 \uc788\ub358 \uac83\ub3c4 \uc88b\uc740 \uae30\uc5b5\uc774\uc5c8\ub2e4.  \\n\\n\uadf8\ub798\uc11c \uc8fc\ubcc0 \uae30\uae30 \uc0dd\ud0dc\uacc4\ub97c apple\ub85c \ubc14\uafb8\ub294 \uae40\uc5d0 \uad6c\ub9e4\ub97c \uacb0\uc815\ud560\uc218 \uc788\uc5c8\ub2e4. \ubcf8\uc778\uc740 \uc560\ud50c\uc6cc\uce58 \uc2dc\ub9ac\uc9886 product red\ub97c \uad6c\ub9e4\ud588\ub2e4.\\n\\n### \uad6c\uc131\\n\ud328\ud0a4\uc9d5\uc740 \uc560\ud50c \ub2f5\uac8c \uc5ed\uc2dc \uae54\ub054\ud558\ub2e4. \\n\\n![\uc560\ud50c\uc6cc\uce58 \ud328\ud0a4\uc9d5](./apple-watch-serise-6/IMG_0126.jpeg)\\n\\n\ud3ec\uc7a5\uc5d0 \uc0ac\uc6a9\ub41c \uc18c\uc7ac\ub294 \uacac\uace0\ud55c \ucf54\ud305\uc9c0\uc778 \uac83 \uac19\ub2e4. \uc190\uc73c\ub85c \uc9d1\uc5b4\ub4e4\uc5c8\uc744 \ub54c \uacac\uace0\ud558\ub2e4\ub294 \ub290\ub08c\uc774 \uac15\ud558\uac8c \ub4e0\ub2e4. \\n\\n![\uc560\ud50c\uc6cc\uce58 \uc5b8\ud328\ud0a4\uc9d5](./apple-watch-serise-6/IMG_0128.jpeg)\\n\\n\uac89 \ud3ec\uc7a5\uc744 \ud480\uba74 \ubcf8\uccb4, \uac01\uc885 \uc124\uba85\uacfc \uc778\uc99d\uc11c\uc640 \uc2a4\ud2b8\ub7a9\uc774 \uc704\uc640 \uac19\uc774 \ubcc4\ub3c4\ub85c \ubb36\uc5ec\uc788\ub2e4.\\n\\n![\uc560\ud50c\uc6cc\uce58 \ub0b4\ubd80 \ud328\ud0a4\uc9d5](./apple-watch-serise-6/IMG_0130.jpeg)\\n\\n\ubcf8\uccb4 \uc0ac\uc9c4\uc774 \uc778\uc1c4\ub41c \uc0c1\uc790\ub97c \uc5f4\uba74 \ucda9\uc804\uae30, \uac01 \uc778\uc99d\uc11c \uc124\uba85\uc11c, \ubcf8\uccb4\uac00 \ub193\uc5ec\uc788\ub2e4. \uc560\ud50c \ub2f5\uac8c \ud3ec\uc7a5\ub3c4 \uc2e0\uacbd\uc368\uc11c \ud588\ub2e4\ub294 \uc778\uc0c1\uc774\ub2e4.  \\n\uc800 \ube68\uac04 \ud55c\uc9c0 \uac19\uc740 \uc885\uc774\uc5d0 \ubcf8\uccb4\uac00 \ub798\ud551\ub418\uc5b4\uc788\ub2e4.\\n\\n![\uc560\ud50c\uc6cc\uce58 \ucda9\uc804](./apple-watch-serise-6/IMG_0117.jpeg)\\n\ubcf8\uccb4\uc640 \uc2a4\ud2b8\ub7a9\uc744 \uc870\ub9bd\ud558\uace0, \ucda9\uc804\uae30\uc5d0 \ubd99\uc774\uba74 \uc790\ub3d9\uc73c\ub85c \ud0c1\uc0c1 \uc2dc\uacc4 \ubaa8\ub4dc\ub85c \ub4e4\uc5b4\uac04\ub2e4. \\n    \\n### \uc0ac\uc6a9\uae30\\n#### \ucc29\uc6a9\uac10\\n\ubcf8\uc778\uc740 \uc55e\uc11c \uc11c\ub450\uc5d0 \uc5b8\uae09\ud55c \ub0b4\uc6a9\uc744 \ubcf4\uba74 \uc190\ubaa9 \uc2dc\uacc4\ub97c \uc990\uaca8 \ucc29\uc6a9\ud558\ub294 \ud3b8\uc774 \uc544\ub2d8\uc744 \uc54c\uc218 \uc788\uc744\uac83\uc774\ub2e4. \ucc45\uc0c1\uc55e\uc5d0 \uc624\ub798 \uc549\uc544\uc788\ub294 \uc0dd\ud65c \ud328\ud134\ub3c4 \uc190\ubaa9\uc758 \uc790\uc720\ub97c \ucc3e\uac8c\ub418\ub294 \uc774\uc720\uc911 \ud558\ub098\uc774\ub2e4.  \\n\uc774 \ub355\uc5d0 \uc190\ubaa9 \uc2dc\uacc4\ub97c \ucc3e\uc9c0 \uc54a\uac8c \ub418\uc5c8\uace0 \uc2a4\ub9c8\ud2b8 \uc6cc\uce58\ub294 \ub2f9\uc5f0\ud788 \ub208\uc5ec\uaca8\ubcf4\uc9c0\ub3c4 \uc54a\uc558\uc5c7\ub2e4.  \\n\\n![\uc560\ud50c \uc6cc\uce58 \ucc29\uc6a9](./apple-watch-serise-6/IMG_0116.jpeg)\\n\\n\uc560\ud50c\uc6cc\uce58\ub294 \uc774\uc804\uc758 \uae30\uc5b4\uc640\ub294 \uc644\uc804\ud788 \ub2ec\ub790\ub2e4. \uc801\ub2f9\ud788 \ud65c\ub3d9\uc801\uc77c \uc218 \uc788\ub294 \ubb34\uac8c\uc5d0 \uc624\ud788\ub824 \uc587\ub2e4\ub294 \ub290\ub08c\uc774 \ub4dc\ub294 \ub450\uaed8\ub294 \uc804\ud600 \ubd80\ub2f4\uc744 \uc8fc\uc9c0 \uc54a\uc558\uace0 \uae30\ubcf8 \uc2a4\ud2b8\ub7a9\uc740 \ub108\ubb34 \ud5d0\uac81\uc9c0\ub3c4 \ub108\ubb34 \ud0c0\uc774\ud2b8\ud558\uc9c0\ub3c4 \uc54a\uac8c \uc801\ub2f9\ud588\ub2e4.  \\n\uae34\ud314\uc744 \uc785\uace0\ub3c4 \ud06c\uac8c \uac78\ub9ac\uc801 \uac70\ub9ac\uc9c0 \uc54a\uc558\uace0 \ucc45\uc0c1\uc5d0\uc11c \ud0c0\uc774\ud551\ud560\ub54c\ub3c4 \ubd88\ud3b8\uac10\uc740 \uc5c6\uc5c8\ub2e4.\\n\\n\ud65c\ub3d9\uc2dc\uc5d0\ub3c4 \uc6cc\ub099 \uac00\ubccd\uace0 \ud06c\uc9c0 \uc54a\uc544 \ubd88\ud3b8\ud558\uc9c0 \uc54a\uc558\ub2e4. \uc77c\ubc18\uc801\uc778 \uc2dc\uacc4\uc815\ub3c4 \ud639\uc740 \uadf8\ubcf4\ub2e4 \ub354 \uc587\ub2e4\ub294 \ub290\ub08c\uc744 \ubc1b\uc558\uace0 \ud3c9\uc18c \uc2dc\uacc4\ub97c \uc790\uc8fc \ucc28\uace0\ub2e4\ub2cc\ub2e4\uba74 \ub290\ub07c\uc9c0 \ubabb\ud560\uac83 \uac19\uc558\ub2e4.   \\n\uc2e4\uc81c\ub85c\ub3c4 \uc775\uc219\ud574\uc9c0\ub2c8 \ucc28\uace0\uc788\ub294 \ub3d9\uc548\uc5d0\ub294 \ubd88\ud3b8\uac10\uc740 \uc5c6\uc5c8\ub2e4. \\n\\n### \uae30\ub2a5\\n\uc560\ud50c \uc6cc\uce58\uc758 \uc874\uc7ac\uac10\uc744 \ub098\ud0c0\ub0b4\ub294 \uae30\ub2a5\uc740 \uc5ed\uc2dc \ud5ec\uc2a4\ucf00\uc5b4\ub77c \uc0dd\uac01\ud55c\ub2e4. \uc77c\uc0c1 \uc18d\uc5d0 \ud398\uc774\uc2a4 \uba54\uc774\ucee4\uc640 \ud568\uaed8 \ub2e4\ub2c8\ub294 \uae30\ubd84\uc744 \ub4e4\uae30\uc5d0 \ucda9\ubd84\ud5f8\ub2e4.\\n\\n\uc2ec\ud638\ud761 \uc138\uc158\uc740 \uc8fc\uae30\uc801\uc73c\ub85c \uc2a4\ud2b8\ub808\uc2a4\ub97c \ub0ae\ucd94\uac8c\ub054 \ub3c4\uc640\uc8fc\uba70 1\uc2dc\uac04 \uc774\uc0c1 \uc6c0\uc9c1\uc774\uc9c0 \uc54a\uac8c\ub418\uba74 \uc790\ub9ac\uc5d0\uc11c \uc77c\uc5b4\ub098 \uc6c0\uc9c1\uc774\uae30\ub97c \uc54c\ub824\uc900\ub2e4.  \\n\ub610\ud55c 5\ubd84 \uc774\uc0c1 \uac77\uac8c \ub418\uba74 \uac77\ub294 \uc18d\ub3c4\uc640 \uc2ec\ubc15\uc218\ub97c \uae30\ub85d\ud574 \ub0b4\uac00 \uc5bc\ub9c8\ub098 \uc774\ub3d9\ud588\ub294\uc9c0\ub97c \ubcf4\uc5ec\uc900\ub2e4. \\n\\n![\uc560\ud50c \uc6cc\uce58 \ucc29\uc6a9](./apple-watch-serise-6/IMG_0116.jpeg)\\n\\n\uc6b4\ub3d9\ub7c9 \uae30\ub85d \ub610\ud55c \ud0c1\uc6d4\ud588\ub2e4. \uc6b4\ub3d9 \uc2dc\uc791 \uc804\uc5d0 \ub0b4\uac00 \ud560 \uc6b4\ub3d9\uc744 \ubbf8\ub9ac \uc815\ud574\ub450\uba74 \uc2ec\ubc15\uc218\uc640 \ud589\ub3d9 \ubaa8\ub2c8\ud130\ub9c1\uc744 \ud1b5\ud574 \uc6b4\ub3d9\ub7c9\uc744 \uae30\ub85d\ud574\uc8fc\uba70  \\n\uce7c\ub85c\ub9ac \uacc4\uc0b0\uc73c\ub85c \ub0b4\uac00 \uc5bc\ub9c8\ub098 \uc6c0\uc9c1\uc600\ub294\uc9c0\ub97c \uc54c\ub824\uc900\ub2e4.  \\n\uc2e4\uc81c\ub85c \ud648\ud2b8\ub808\uc774\ub2dd\uc744 \uac15\uc81c\ub85c \ud558\uace0\uc788\ub294 \uc694\uc998\uc5d4 \uac1c\uc778 PT\ub97c \ubc1b\ub294 \ub290\ub08c\uc744 \ubc1b\uc744 \uc218 \uc788\uc5c8\ub2e4. \uc6b4\ub3d9 \uc2dc\uac04, \uc6b4\ub3d9\ub7c9\uc744 \uc815\ub7c9\uc801\uc73c\ub85c \uc54c\ub824\uc900\ub2e4\ub294 \uac83\uc774 \uc544\uc8fc \ub9c8\uc74c\uc5d0 \ub4e4\uc5c8\ub2e4. \\n    \\n\ucd94\uac00\uc801\uc73c\ub85c \uc560\ud50c \uc6cc\uce58\ub97c \ucc29\uc6a9\ud558\uace0\uc788\ub294 \ub3d9\uc548\uc5d0\ub294 \ub9e5\ubd81 \uc7a0\uae08 \ud574\uc81c\ub97c \uc790\ub3d9\uc73c\ub85c \ud560 \uc218 \uc788\ub2e4. Touch ID\ub97c \uc0ac\uc6a9\uc911\uc774\ub354\ub77c\ub3c4 \uc560\ud50c\uc6cc\uce58\ub97c \ucc29\uc6a9\uc911\uc774\ub77c\uba74 \uc54c\uc544\uc11c \uc7a0\uae08\ud574\uc81c\ub418\uc5b4 \ube60\ub974\uac8c \ud558\ub358 \uc77c\uc744 \uc774\uc5b4\uac08 \uc218 \uc788\ub2e4.\\n    \\n### \uad6c\ub9e4 \ucd94\ucc9c\\n\uc560\ud50c\uc6cc\uce58\ub294 \uc560\ud50c \uc0dd\ud0dc\uacc4\uc5d0\uc11c\ub9cc \uc704\ub825\uc744 \ubc1c\ud718\ud55c\ub2e4. \uc560\ud50c \uc0dd\ud0dc\uacc4\uc5d0 \uc788\uac70\ub098 \uc62e\uae38 \uacc4\ud68d\uc774\ub77c\uba74 \uad6c\ub9e4\ub97c \ucd94\ucc9c\ud55c\ub2e4.  \\n\uacfc\uc7a5 \uc870\uae08 \ubcf4\ud0e0\ub2e4\uba74 \uac1c\uc778 \ube44\uc11c\ub97c \ub454\uac83 \uac19\uc740 \uacbd\ud5d8\uc744 \uc5bb\uc744 \uc218 \uc788\ub2e4.\\n\\n\ucd5c\uadfc \uc5c5\ub370\uc774\ud2b8\ub97c \ud1b5\ud574 \ubcf8\uc778\uc774 \uc544\uc774\ud3f0\uc744 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\ub354\ub77c\ub3c4 \uac00\uae4c\uc6b4 \uc8fc\ubcc0\uc778\uc774 \uc0ac\uc6a9\uc911\uc774\ub77c\uba74 \uc5f0\ub3d9\ud560 \uc218 \uc788\uac8c \ub418\uc5c8\ub2e4. \uc870\uae08\uc740 \ubd88\ud3b8 \ud558\uc9c0\ub9cc \uac00\uc871 \uc0ac\uc6a9\uc774\ub77c\uba74 \ucda9\ubd84\ud574 \ubcf4\uc778\ub2e4.  \\n\ub0b4\uac00 \uc544\uc774\ud3f0\uc744 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uace0 \ub0b4 \uc8fc\ubcc0\uc5d0 \uc544\uc774\ud3f0 \uc0ac\uc6a9\uc790\uac00 \uc5c6\ub2e4\uba74 \uad6c\ub9e4\ud560 \uc774\uc720\uac00 \uc5c6\ub2e4. \uc5f0\ub3d9\ud560 \ubc29\ubc95\uc774 \uc5c6\uae30 \ub54c\ubb38\uc774\ub2e4.\\n\\nimport CoupangPartners from \'@site/src/components/coupang-partners\'\\n\\n<CoupangPartners\\n    adID=\\"527409\\"\\n    template=\\"carousel\\"\\n    trackingCode=\\"AF8809335\\"\\n    width={680}\\n    height={140}\\n/>"},{"id":"/blog/review/ipad-pro-gen2","metadata":{"permalink":"/blog/blog/review/ipad-pro-gen2","source":"@site/blog/2021-01-12-review-ipad-pro-gen2.md","title":"\uc544\uc774\ud328\ub4dc \ud504\ub85c 2\uc138\ub300 \ub9ac\ubdf0","description":"\uc560\ud50c \uc0dd\ud0dc\uacc4\uc5d0 \uc785\ubb38\ud558\uac8c \ub9cc\ub4e0 iPad Pro 2\uc138\ub300 \ub9ac\ubdf0","date":"2021-01-12T00:00:00.000Z","formattedDate":"January 12, 2021","tags":[{"label":"Review","permalink":"/blog/tags/review"},{"label":"iPad Pro Gen4","permalink":"/blog/tags/i-pad-pro-gen-4"}],"readingTime":8.985,"truncated":true,"authors":[{"name":"Jeonghun Kong","title":"Full stack developer","url":"https://github.com/rhdtl78","imageURL":"https://github.com/rhdtl78.png","key":"rhdtl78"}],"prevItem":{"title":"\uc560\ud50c \uc6cc\uce58 \uc2dc\ub9ac\uc9886 \ub9ac\ubdf0","permalink":"/blog/blog/review/apple-watch-series-6"},"nextItem":{"title":"\ub9e5\ubd81 \ud504\ub85c 2018 15\uc778\uce58 \ud130\uce58\ubc14 \ub9ac\ubdf0","permalink":"/blog/blog/review/macbook-pro-2018-15-inch-touch-bar-review"}},"content":"![\ud654\uba74](./ipad-pro-gen2/screen.jpeg)\\n\\n\x3c!--truncate--\x3e\\n\\n### \ub9e5\ubd81 \ub2e4\uc74c\uc73c\ub85c \ub098\uc758 \ub9c8\uc74c\uc744 \uc0ac\ub85c\uc7a1\uc740, \ub098\ub97c \uc560\ud50c \uc0dd\ud0dc\uacc4\ub85c \ubab0\uc544\ub123\uc740 \uae30\uae30\ub97c \ub9ac\ubdf0\ud558\ub824\ud55c\ub2e4.\\n\\niPad Pro 4\uc138\ub300 \uc774\uc804\uc5d0 \uc774\ubbf8 Galaxy tab s7\uc744 \uc0ac\uc6a9\ud558\uace0\uc788\uc5c8\ub2e4. \ubbf8\ub514\uc5b4 \uc18c\ube44\uc6a9, \uc5c5\ubb34\uc2dc \uc124\uacc4\ubc0f \ub178\ud2b8\uc6a9\uc744 \uc798 \uc0ac\uc6a9\ud558\uace0 \uc788\uc5c8\uc73c\ub098, \ub9e5\uacfc\uc758 \uc5f0\ub3d9\uc740 \uc11c\ub4dc\ud30c\ud2f0\uc571\uc744 \uc0ac\uc6a9\ud588\uc5b4\uc57c \ud588\uace0,  \\n\uadf8 \ub9c8\uc800\ub3c4 \ub9e4\ub044\ub7fd\uc9c0 \ubabb\ud588\ub2e4. \ud39c\uc774 \ud3ec\ud568\ub418\uc5b4\uc788\uc5b4\uc11c \ud0dc\ube14\ub9bf \uc790\uccb4\ub9cc\uc73c\ub85c\ub294 \uc644\uc131\ub3c4\uac00 \ub192\uc558\uc73c\ub098, \ub9e5\ubd81\uc744 \uc0ac\uc6a9\ud558\ub294 \uc785\uc7a5\uc5d0\uc11c\ub294 \uac77\ub3cc\uace0\uc788\ub2e4\ub294 \uc0dd\uac01\uc774 \ub5a0\ub098\uc9c8 \uc54a\uc558\ub2e4.  \\n\uc2ec\uc9c0\uc5b4\ub294 \uc774\uc5b4\ud3f0 \ub9c8\uc800 \uc5d0\uc5b4\ud31f 1\uc138\ub300\ub97c \uc0ac\uc6a9\ud558\uace0 \uc788\uc5b4\uc11c \ud398\uc774\ub9c1\uc774 \uc790\uc8fc \ub04a\uc5b4\uc9c0\ub294 \ud604\uc0c1\ub3c4 \uacaa\uace0 \uc788\uc5c8\ub2e4. \uadf8\ub7f0 \uc640\uc911\uc5d0 s7 \ud50c\ub7ec\uc2a4 \ubaa8\ub378\uc758 \ucd9c\uc2dc\uac00 \ud655\uc815\ub418\uc5c8\uace0,  \\n\uc911\uace0\uac12\uc774 \ub354 \ub5a8\uc5b4\uc9c0\uae30 \uc804\uc5d0 \ucc98\ubd84\ud558\uace0 \uac08\uc544\ud0c0\uac8c \ub418\uc5c8\ub2e4.\uad6c\ub9e4\ub294 \ucfe0\ud321\uc5d0\uc11c \ub85c\ucf13\uc73c\ub85c \uad6c\ub9e4\ud588\ub2e4. \ub2f9\uc2dc \ub2e4\uc74c \uc138\ub300 ipad \uc5d0\uc5b4\uc758 \ud3fc\ud329\ud130 \uc804\ud658\uc774 \uae30\uc815 \uc0ac\uc2e4\ud654 \ub418\uc5b4\uc788\ub358 \uc2dc\uae30\uc5ec\uc11c \uae30\ub2e4\ub9b4\uae4c \uc0dd\uac01\ud588\uc5c8\uc9c0\ub9cc, \uc774\ubbf8 \ud0dc\ube14\ub9bf\uc744 \ucc98\ubd84\ud55c \uc0c1\ud0dc\uc600\uae30\uc5d0 \ubc14\ub85c iPad Pro 4\uc138\ub300\uc640 Apple Pencil2 \uad6c\ub9e4\ud588\ub2e4.\\n\\n## 1. \ub514\uc790\uc778\\n\\n\uc560\ud50c \ub2e4\uc6b4 \ub9c8\uac10\uc744 \ubcf4\uc5ec\uc900\ub2e4. \ub9cc\ub4e6\uc0c8\ub294 \ubcf4\uc790\ub9c8\uc790 \uc88b\ub2e4\ub294 \uac83\uc774 \ubc14\ub85c \ub290\uaef4\uc9c0\uace0, \ucd9c\uc2dc \ub2f9\uc2dc\uc5d0 \ub17c\ub780\uc774 \uc788\uc5c8\ub358 \ubc34\ub4dc \uac8c\uc774\ud2b8\ub3c4 \ubcf4\uc774\uc9c0 \uc54a\uc558\ub2e4.\\n\\n![\ubc15\uc2a4\uc640 \ubcf8\uccb4](./ipad-pro-gen2/with-box.jpeg)\\n\\n![\uc815\uba74](./ipad-pro-gen2/front.jpeg)\\n\\n\uc815\uba74\uc5d0\ub294 \uac15\ud654\uc720\ub9ac \ud544\ub984\uc744 \ubd99\uc5ec\ub193\uc740 \uc0c1\ud0dc\uc774\ub2e4. \ud39c\uc2ac\uc744 \uc4f0\uba74\uc11c \ud654\uba74\uc744 \ubcf4\ud638\ud558\uae30 \uc704\ud574 \uac15\ud654\uc720\ub9ac\ub97c \uad6c\ub9e4\ud588\ub2e4. \uc885\uc774 \uc9c8\uac10\uc740 \ud3c9\uc774 \uc88b\uc9c0 \uc54a\uc544\uc11c \uc120\ud0dd\ud558\uc9c0 \uc54a\uc558\ub2e4.\\n\\n![\uc0c1\ub2e8](./ipad-pro-gen2/top.jpeg)\\n\\n\uc0c1\ub2e8\uc5d0\ub294 \ub2e4\ub978 \uac83\uc740 \uc5c6\uc774 \uc804\uc6d0 \ubc84\ud2bc\ub9cc \uc704\uce58\ud574\uc788\ub2e4. \uc2a4\ud53c\ucee4\ub294 \uc0c1 \ud558\ub2e8\uc5d0 4\uac1c\uc758 \uc2a4\ud14c\ub808\uc624 \uad6c\uc131\uc73c\ub85c \uc704\uce58\ud574\uc788\ub2e4.\\n\\n![\ud558\ub2e8](./ipad-pro-gen2/bottom.jpeg)\\n\\n\ud558\ub2e8\uc5d0\ub294 \ub9c8\ucc2c\uac00\uc9c0\ub85c \uc2a4\ud53c\ucee4\uac00 \uc704\uce58\ud574\uc788\uace0 USB Type-C \ud3ec\ud2b8\uac00 \uc704\uce58\ud574\uc788\ub2e4. Type-C \ud3ec\ud2b8 \ub355\uc5d0 \ud655\uc7a5\uc131\uacfc \ud638\ud658\uc131\uc5d0 \ubb34\ub9ac\uac00 \uc5c6\uc5c8\ub2e4.\\n\\n![\uc88c\uce21](./ipad-pro-gen2/left.jpeg)\\n\\n\uc88c\uce21\uc5d0\ub294 \ubcc4\ub2e4\ub978 \ubc84\ud2bc\uc740 \uc5c6\uace0 \ub9c8\uc774\ud06c\ub9cc \ud558\ub098 \uc704\uce58\ud574\uc788\ub2e4.\\n\\n![\uc6b0\uce21](./ipad-pro-gen2/right.jpeg)\\n\\n\uc6b0\uce21\uc5d0\ub294 \ubcfc\ub968 \ubc84\ud2bc\uacfc \ub9c8\uadf8\ub124\ud2f1 \ucee4\ub125\ud130\uac00 \uc704\uce58\ud574 \uc788\ub2e4. \uc774 \ub9c8\uadf8\ub124\ud2f1 \ucee4\ub125\ud130\ub294 \uc608\uc0c1\ud560 \uc218 \uc788\ub4ef\uc774 \ud39c\uc2ac\uc744 \ubd99\uc5ec \ucda9\uc804\ud558\ub294 \uacf3\uc774\ub2e4.\\n\\n![\ud6c4\uba74](./ipad-pro-gen2/back.jpeg)\\n\\n\ub4b7\uba74\uc740 \uc560\ud50c \ub2e4\uc6b4 \ub514\uc790\uc778\uc73c\ub85c, \uad70\ub354\ub354\uae30 \uc5c6\uc774 \uae54\ub054\ud558\ub2e4. \uadf8\ub9ac\uace0 \uace0\uc131\ub2a5\uc758 \uce74\uba54\ub77c\uc640 \ud50c\ub798\uc2dc, \ub77c\uc774\ub2e4(LiDAR)\uc13c\uc11c\uac00 \uc704\uce58\ud574\uc788\ub2e4. \ud558\ub2e8\uc5d0\ub294 \ub9e4\uc9c1 \ud0a4\ubcf4\ub4dc\ub97c \uc704\ud55c \uc2a4\ub9c8\ud2b8 \ucee4\ub125\ud130\uac00 \uc704\uce58\ud574\uc788\ub2e4.\\n\\n![\ubc15\uc2a4 \uad6c\uc131](./ipad-pro-gen2/in-box.jpeg)\\n\\n\ubc15\uc2a4 \uad6c\uc131\uc740 \ubcf8\uccb4, C-to-C Cable, 28W \ucda9\uc804\uae30\uac00 \ud3ec\ud568\ub418\uc5b4\uc788\ub2e4. \ucda9\uc804\uae30\ub294 \uc0ac\ubb34\uc2e4\uc5d0 \uac16\ub2e4\ub17c \uc0c1\ud0dc\ub77c \uc0ac\uc9c4\uc5d0 \ud3ec\ud568\ub418\uc9c0 \uc54a\uc558\ub2e4.\\n\\n![\ud39c\uc2ac](./ipad-pro-gen2/pencil.jpeg)\\n\\n\ucd94\uac00\ub85c \uad6c\ub9e4\ud55c Apple Pencil 2\uc138\ub300. 1\uc138\ub300\ub294 \ud638\ud658\ub418\uc9c0 \uc54a\ub294\ub2e4. \ucda9\uc804\ud560 \uc218 \uc5c6\uace0, \uaf42\uc744 \uc218 \uc5c6\uae30 \ub54c\ubb38\uc5d0 \ud398\uc5b4\ub9c1\uc774 \uc5b4\ub835\ub2e4.\\n\\n![\ud654\uba74](./ipad-pro-gen2/screen.jpeg)\\n\\n\uc704\uc640 \uac19\uc774 \ud39c\uc2ac\uc744 \ubd99\uc5ec \ucda9\uc804\ud55c\ub2e4.\\n\\n\uc804\ubc18\uc801\uc73c\ub85c \ub192\uc740 \uc218\uc900\uc758 \ub9c8\uac10\uc744 \ubcf4\uc5ec\uc900\ub2e4. \uc560\ud50c \ub2f5\uac8c \ucf00\uc774\uc2a4\uc640 \ud544\ub984 \uc5c6\uc774 \uc0ac\uc6a9\ud558\uace0 \uc2f6\uc740 \uc644\uc131\ub3c4\uc640 \uacac\ub3c4\ud568\uc774\uc5c8\ub2e4. \uc2e4\uc81c\ub85c \uc9d1\uc5d0\uc11c, \uce68\ub300 \uc704\uc5d0\uc11c\ub294 \ub9d8\ud3b8\ud788 \ucf00\uc774\uc2a4 \uc5c6\uc774 \uc0ac\uc6a9\ub294\ub370 \uc0c1\ub2f9\ud788 \ub9cc\uc871\uc2a4\ub7fd\ub2e4.\\n\\n## 2. \uc131\ub2a5\\n\\nA12Z Bionic \ud504\ub85c\uc138\uc11c\ub294 \uc5b4\ub5a4 \uc791\uc5c5\uc5d0\uc11c\ub3c4 \ubc84\ubc85\uc784\uc744 \ucc3e\uc544 \ubcfc \uc218 \uc5c6\uc5c8\ub2e4. \uc8fc\ub85c \uc0ac\uc6a9\ud558\ub294 \uc571\uc740 \uc790\uccb4 \uc571\uc778 memo \uc640 Autodesk\uc758 Sketch\uc778\ub370, \uadf8 \ub458\uc744 \ubc88\uac08\uc544 \uac00\uba70 \uc0ac\uc6a9\ud568\uc5d0 \uadf8 \uc5b4\ub5a0\ud55c \uc9c0\uc5f0\ub3c4 \ubcfc \uc218 \uc5c6\uc5c8\ub2e4.\\n\uce74\uba54\ub77c \ub610\ud55c 12MP\uc758 \uad11\uac01, 10MP\uc758 \ucd08 \uad11\uac01 \uce74\uba54\ub77c 2\uac1c\ub85c \uc5ec\ud0c0 \ud0dc\ube14\ub9bf\uc5d0\uc11c \ucc3e\uc544 \ubcfc \uc218 \uc5c6\ub294 \ub192\uc740 \uc218\uc900\uc758 \uc0ac\uc9c4\uc744 \ucc0d\uc744 \uc218 \uc788\uc5c8\ub2e4.\\n\\n\uc804\uba74 \ub514\uc2a4\ud50c\ub808\uc774\ub294 12.9\uc778\uce58\uc758 \uc544\uc8fc \uc2dc\uc6d0\ud55c \ud06c\uae30\ub85c, \ud574\uc0c1\ub3c4 \ub610\ud55c 264ppi\ub85c \uc544\uc8fc \uc120\uba85\ud558\ub2e4. \ub610\ud55c \uc560\ud50c\uc758 \uc720\uba85\ud55c True Tone \ub514\uc2a4\ud50c\ub808\uc774\uac00 \uc801\uc6a9\ub418\uc5b4 \uc790\uc5f0\uc2a4\ub7ec\uc6b4 \uc0c9\uac10\uc744 \ubcf4\uc5ec\uc900\ub2e4.  \\n\uc2a4\ud399\uc0c1\uc5d0\ub294 \ubc18\uc0ac\ubc29\uc9c0 \ucf54\ud305\uc774 \ub418\uc5b4\uc788\uc73c\ub098, \ud39c\uc2ac\uc744 \uc0ac\uc6a9\ud55c\ub2e4\uba74 \ud544\ub984 \uc0ac\uc6a9\uc744 \ucd94\ucc9c\ud55c\ub2e4. \ucf54\ud305\uc740 \uc5b8\uc820\uac04 \ub2f3\uc544 \uc5c6\uc5b4\uc9c8 \uac83\uc774\uae30 \ub54c\ubb38\uc774\ub2e4.\\n\ud654\uba74 \uc8fc\uc0ac\uc728\uc740 120Hz\ub97c \uc9c0\uc6d0\ud558\uae30\ub294 \ud558\ub098 \uac00\ubcc0\ud615\uc73c\ub85c \ud544\uc694\ud55c \uc2dc\uc810\uc5d0 \uc790\ub3d9\uc73c\ub85c \ud65c\uc131\ud654 \ub41c\ub2e4. \ud574\ub2f9 \uc635\uc158\uc744 \ud65c\uc131\ud654 \ud55c \ud6c4 \ud648\ud654\uba74\uc5d0\uc11c \uba87\ubc88 \ub118\uaca8\ubcf4\uae30\ub9cc \ud574\ub3c4 \uccb4\uac10\ub41c\ub2e4.\\n\\n\ubc30\ud130\ub9ac\ub294 \uc0ac\uc6a9 \uacbd\ud5d8 \uc0c1 \ub300\uae30 \uc2dc\uac04\uc73c\ub85c \ud39c\uc2ac\uc744 \ubd99\uc5ec\ub193\uc740 \uc0c1\ud0dc\ub85c 1\uc8fc\uc77c \uc870\uae08 \uc548\ub418\ub294 \uac83 \uac19\ub2e4. \uc5f0\uc18d \uc0ac\uc6a9\uc2dc WIFI \ud658\uacbd, \ubc1c\uae30 50%\uc5d0\uc11c \ud558\ub8e8 \uc870\uae08 \uc548\ub418\uac8c \ubc84\ud168\uc8fc\ub294\uac83 \uac19\ub2e4.  \\n\ud3b8\ucc28\uac00 \ucee4\ubcf4\uc774\ub294\ub370 \uc774\ub294 \uac00\ubcc0\ud615 120Hz \uc8fc\uc0ac\uc728 \ub54c\ubb38\uc778 \uac83\uc73c\ub85c \ubcf4\uc778\ub2e4.\\n\\n\uc544\uc774\ud328\ub4dc \ud504\ub85c\uc758 \uc9c4\uac00\ub294 \ud39c\uc2ac\uacfc \ud568\uaed8 \ud560\ub54c \ub098\ud0c0\ub09c\ub2e4. 120hz\uc640 A12Z bionic \ub355\uc5d0 \uc815\ub9d0 \uc885\uc774\uc5d0 \ud39c\uc73c\ub85c \uc801\ub294 \uac83 \uac19\uc740 \uacbd\ud5d8\uc744 \ud560 \uc218 \uc788\ub2e4.  \\n\ud39c\uc73c\ub85c \uae0b\ub294 \ubaa8\ub4e0 \ud68d\uc774 \ubc14\ub85c \ubc18\uc751\uc744 \ubcf4\uc774\uba70, \ub0b4\uc7a5\ub41c \ub274\ub7f4 \uc5d4\uc9c4\uc758 \ubcf4\uc815 \ub355\uc5d0 \uc790\uc5f0\uc2a4\ub7ec\uc6b4 \ud544\uae30\ub97c \uacbd\ud5d8\ud560 \uc218 \uc788\ub2e4.\\n\\n## 3. \uad6c\ub9e4 \ucd94\ucc9c\\n\\n\uc774\ubbf8 \uc560\ud50c \uc0dd\ud0dc\uacc4\uc560 \uc788\uace0, \uc544\uc774\ud328\ub4dc\uac00 \uc5c6\ub2e4\uba74 \uac15\ub825\ud788 \ucd94\ucc9c\ud55c\ub2e4. \ud3f0\uc758 \ud654\uba74\uc774 \uc544\uc8fc \ucee4\uc838 \ucee8\ud150\uce20 \uc18c\ube44\uc5d0 \ubb34\ub9ac\uac00 \uc5c6\ub2e4 \ud558\uc9c0\ub9cc, \uc2e4\ub0b4\uc5d0\uc11c\uc758 \ud0dc\ube14\ub9bf \uc0ac\uc6a9\uc744 \ub530\ub77c\uc7a1\uc744 \uc21c \uc5c6\uc744 \uac83\uc774\ub2e4.  \\n \ub9e5\uc758 \uc0ac\uc774\ub4dc\uce74 \uae30\ub2a5\uc73c\ub85c \ubb34\uc120 \ud655\uc7a5 \ubaa8\ub2c8\ud130\ub85c\ub3c4 \ud65c\uc6a9\ud560 \uc218 \uc788\uc73c\uba70, \ud39c\uc2ac\uc774 \uc788\ub2e4\uba74 \ubb34\uc120 \uc561\uc815 \ud0dc\ube14\ub9bf\uc73c\ub85c \ud65c\uc6a9\ud560 \uc218 \uc788\ub2e4. \uac1c\ubc1c\uc790\uc778 \ud544\uc790\ub294 simulator \ub97c sidecar\ub85c ipad\uc5d0 \ub744\uc6cc \ud39c\uc2ac\ub85c \ucee8\ud2b8\ub864\ud558\uac70\ub098  \\n \ud130\ubbf8\ub110 \ud654\uba74\uc744 \ub118\uaca8 \uc0ac\uc6a9\ud574 \ud3b8\ub9ac\ud588\ub2e4.\\n\\n\uc5ec\uc720\uac00 \ub41c\ub2e4\uba74 \ud559\uc0dd\ubd84\ub4e4\ub3c4 \ud39c\uc2ac\uacfc \ud568\uaed8 \uad6c\ub9e4\ud558\uae30\ub97c \ucd94\ucc9c\ud55c\ub2e4. \ub300\ud559\uc0dd \ud544\uae30\uc5d0 \uc544\uc8fc\uc744 \uac83\uc73c\ub85c \uc0dd\uac01\ub41c\ub2e4. \uc790\ub3d9\uc73c\ub85c \ubc31\uc5c5\ub418\ub294 \uc790\uccb4 \uc571\uc73c\ub85c \ud544\uae30 \ud560 \uc218 \uc788\uace0, \uc720\uba85\ud55c \ub178\ud2b8 \uc571\uc744 \ud65c\uc6a9\ud574 \uccb4\uacc4\uc801\uc778 \ub178\ud2b8\ub97c \ub9cc\ub4e4 \uc218\ub3c4 \uc788\ub2e4.\\n\ub2e8\uc21c\ud788 \ucee8\ud150\uce20 \uc18c\ube44\uc6a9\uc774\ub77c\uba74, \ucd94\ucc9c\ud558\uc9c0 \uc54a\ub294\ub2e4. \uac00\uaca9\uc774 \uac00\uaca9\uc778 \ub9cc\ud07c \uc0dd\uc0b0\uc131\uc744 \ucc59\uaca8\uc57c \ub3c8\uac12\uc744 \ud55c\ub2e4 \ub290\ub084 \uc218 \uc788\ub2e4.\\n\\n## 4. \ucd1d\ud3c9\\n\\n\uae30\uc874\uc5d0 \ud0dc\ube14\ub9bf \uc0ac\uc6a9\uc5d0 \uc775\uc219\ud588\ub358 \ud544\uc790\ub294 \ud754\ud788 \uac00\uc131\ube44 \ud0dc\ube14\ub9bf\ub4e4\uc744 \uc804\uc804\ud588\uc5c8\ub2e4. \uc5c5\ubb34\uc6a9\uc73c\ub85c \uc4f0\ub2e4 \ud544\uc694\uc5c6\uc73c\uba74 \ucc98\ubd84\ud558\uba74\uc11c \uc5ec\ub7ec \ud0dc\ube14\ub9bf\uc744 \uc804\uc804\ud588\uc73c\ub098 \uc774\uc81c ipad\ub85c \uc815\ucc29\ud558\uac8c \ub418\uc5c8\ub2e4.  \\n\uc791\uc5c5 \uc0ac\uc774\uc5d0 \uc791\uc740 \uc9c0\uc5f0\uc774 \uc0dd\uac01\ubcf4\ub2e4 \uc5c5\ubb34\uc758 \ud750\ub984\uc744 \ubc29\ud574\ud558\ub294 \uacbd\uc6b0\uac00 \ub9ce\uc558\uc5c8\ub294\ub370 ipad\uc5d0\uc11c\ub294 \uc804\ud600 \ucc3e\uc544\ubcfc \uc218 \uc5c6\uc5c8\ub2e4.\\n\\nimport CoupangPartners from \'@site/src/components/coupang-partners\'\\n\\n<CoupangPartners\\n  adID=\\"527409\\"\\n  template=\\"carousel\\"\\n  trackingCode=\\"AF8809335\\"\\n  width={680}\\n  height={140}\\n/>"},{"id":"/blog/review/macbook-pro-2018-15-inch-touch-bar-review","metadata":{"permalink":"/blog/blog/review/macbook-pro-2018-15-inch-touch-bar-review","source":"@site/blog/2021-01-04-review-macbook.md","title":"\ub9e5\ubd81 \ud504\ub85c 2018 15\uc778\uce58 \ud130\uce58\ubc14 \ub9ac\ubdf0","description":"\uac1c\ubc1c\uc790\ub85c\uc11c \ub9e5\ubd81\ud504\ub85c\ub97c 2\ub144\uac04 \uc0ac\uc6a9\ud55c \ud6c4\uae30.","date":"2021-01-04T00:00:00.000Z","formattedDate":"January 4, 2021","tags":[{"label":"Review","permalink":"/blog/tags/review"},{"label":"Macbook Pro","permalink":"/blog/tags/macbook-pro"}],"readingTime":12.005,"truncated":true,"authors":[{"name":"Jeonghun Kong","title":"Full stack developer","url":"https://github.com/rhdtl78","imageURL":"https://github.com/rhdtl78.png","key":"rhdtl78"}],"prevItem":{"title":"\uc544\uc774\ud328\ub4dc \ud504\ub85c 2\uc138\ub300 \ub9ac\ubdf0","permalink":"/blog/blog/review/ipad-pro-gen2"}},"content":"![\uc2a4\ud2f8\uc0f7](./macbook-pro/IMG_0081.png)\\n\\n\x3c!--truncate--\x3e\\n\ud544\uc790\ub294 2019\ub144 \ucd08, \uc5c5\ubb34\uc6a9 \ub7a9\ud0d1\uc73c\ub85c \ub9e5\ubd81 \ud504\ub85c 15 \uc778\uce58 2018 \ud130\uce58\ubc14 \ubaa8\ub378\uc744 \uad6c\ub9e4\ud588\ub2e4. 2021\ub144\uc744 \ub9de\uc774\ud574, \uc57d 2\ub144\uac04\uc758 \uc0ac\uc6a9\uae30\uc5d0 \ub300\ud574 \uc774\uc57c\uae30\ud558\ub824 \ud55c\ub2e4.\\n\\n## 1. Spec \\n\ubcf8\uc778\uc774 \uad6c\ub9e4\ud55c \uc0c1\uc138 \uc2a4\ud399\uc740 \ub2e4\uc74c\uacfc \uac19\ub2e4.\\n\\n> <h3>Touch Bar</h3>\\n> \\n> <ul>\\n> \\t<li>Touch ID \uc13c\uc11c\uac00 \ub0b4\uc7a5\ub41c Touch Bar</li>\\n> </ul>\\n> \\n> <h3>\ub9c8\uac10</h3>\\n> \\n> <ul>\\n> \\t<li>\uc2e4\ubc84</li>\\n> \\t<li>\uc2a4\ud398\uc774\uc2a4 \uadf8\ub808\uc774</li>\\n> </ul>\\n> \\n> <h3>\ub514\uc2a4\ud50c\ub808\uc774</h3>\\n> \\n> <ul>\\n> \\t<li>Retina \ub514\uc2a4\ud50c\ub808\uc774</li>\\n> \\t<li>15.4\ud615(\ub300\uac01\uc120) LED \ubc31\ub77c\uc774\ud2b8 \ub514\uc2a4\ud50c\ub808\uc774(IPS \uae30\uc220), 2880 x 1800 \uae30\ubcf8 \ud574\uc0c1\ub3c4(220ppi)\ub85c \uc218\ubc31\ub9cc \uc0c9\uc0c1 \uc9c0\uc6d0</li>\\n> \\t<li>\uc9c0\uc6d0 \uac00\ub2a5 \ud574\uc0c1\ub3c4:\\n> \\t<ul>\\n> \\t\\t<li>1920 x 1200</li>\\n> \\t\\t<li>1680 x 1050</li>\\n> \\t\\t<li>1280 x 800</li>\\n> \\t\\t<li>1024 x 640</li>\\n> \\t</ul>\\n> \\t</li>\\n> \\t<li>500 \ub2c8\ud2b8 \ubc1d\uae30</li>\\n> \\t<li>\ub113\uc740 \uc0c9\uc601\uc5ed(P3)</li>\\n> \\t<li>True Tone \uae30\uc220</li>\\n> </ul>\\n> \\n> <h3>\ud504\ub85c\uc138\uc11c</h3>\\n> \\n> <ul>\\n> \\t<li><b>2.2GHz</b><br/>\\n> \\t2.2GHz 6\ucf54\uc5b4 Intel Core i7(\ucd5c\ub300 4.1GHz Turbo Boost, 9MB \uacf5\uc720 L3 \uce90\uc2dc)<br/>\\n> \\t<em>2.9GHz 6\ucf54\uc5b4 Intel Core i9(\ucd5c\ub300 4.8GHz Turbo Boost, 12MB \uacf5\uc720 L3 \uce90\uc2dc)\uc73c\ub85c \uad6c\uc131 \uac00\ub2a5</em></li>\\n> \\t<li><b>2.6GHz</b><br/>\\n> \\t2.6GHz 6\ucf54\uc5b4 Intel Core i7(\ucd5c\ub300 4.3GHz Turbo Boost, 9MB \uacf5\uc720 L3 \uce90\uc2dc)<br/>\\n> \\t<em>2.9GHz 6\ucf54\uc5b4 Intel Core i9(\ucd5c\ub300 4.8GHz Turbo Boost, 12MB \uacf5\uc720 L3 \uce90\uc2dc)\uc73c\ub85c \uad6c\uc131 \uac00\ub2a5</em></li>\\n> </ul>\\n> \\n> <h3>\uc800\uc7a5 \uc7a5\uce58<sup>1</sup></h3>\\n> \\n> <ul>\\n> \\t<li><b>256GB</b><br/>\\n> \\t256GB SSD<br/>\\n> \\t<em>512GB, 1TB, 2TB \ub610\ub294 4TB SSD\ub85c \uad6c\uc131 \uac00\ub2a5</em></li>\\n> \\t<li><b>512GB</b><br/>\\n> \\t512GB SSD<br/>\\n> \\t<em>1TB, 2TB \ub610\ub294 4TB SSD\ub85c \uad6c\uc131 \uac00\ub2a5</em></li>\\n> </ul>\\n> \\n> <h3>\uba54\ubaa8\ub9ac</h3>\\n> \\n> <ul>\\n> \\t<li>16GB 2400MHz DDR4 \uc628\ubcf4\ub4dc \uba54\ubaa8\ub9ac<br/>\\n> \\t<em>32GB \uba54\ubaa8\ub9ac\ub85c \uad6c\uc131 \uac00\ub2a5</em></li>\\n> </ul>\\n> \\n> <h3>\uadf8\ub798\ud53d</h3>\\n> \\n> <ul>\\n> \\t<li><b>2.2GHz</b><br/>\\n> \\tRadeon Pro 555X(4GB GDDR5 \uba54\ubaa8\ub9ac \ubc0f \uc790\ub3d9 \uadf8\ub798\ud53d \uc804\ud658 \uae30\ub2a5 \ud0d1\uc7ac)<br/>\\n> \\tIntel UHD Graphics 630<br/>\\n> \\t<em>Radeon Pro 560X(4GB GDDR5 \uba54\ubaa8\ub9ac)\ub85c \uad6c\uc131 \uac00\ub2a5</em></li>\\n> \\t<li><b>2.6GHz</b><br/>\\n> \\tRadeon Pro 560X(4GB GDDR5 \uba54\ubaa8\ub9ac \ubc0f \uc790\ub3d9 \uadf8\ub798\ud53d \uc804\ud658 \uae30\ub2a5 \ud0d1\uc7ac)<br/>\\n> \\tIntel UHD Graphics 630<br/>\\n> \\t<em>Radeon Pro Vega 16(4GB HBM2 \uba54\ubaa8\ub9ac) \ub610\ub294 Radeon Pro Vega 20(4GB HBM2 \uba54\ubaa8\ub9ac)\ub85c \uad6c\uc131 \uac00\ub2a5</em></li>\\n> </ul>\\n> \\n> <h3>\ucda9\uc804 \ubc0f \ud655\uc7a5</h3>\\n> \\n> <p>\ub2e4\uc74c\uc744 \uc9c0\uc6d0\ud558\ub294 Thunderbolt 3(USB-C) \ud3ec\ud2b8 4\uac1c:</p>\\n> \\n> <ul>\\n> \\t<li>\ucda9\uc804</li>\\n> \\t<li>DisplayPort</li>\\n> \\t<li>Thunderbolt(\ucd5c\ub300 40Gbps)</li>\\n> \\t<li>USB 3.1 2\uc138\ub300(\ucd5c\ub300 10Gbps)</li>\\n> </ul>\\n> \\n> <h3>\ud0a4\ubcf4\ub4dc \ubc0f \ud2b8\ub799\ud328\ub4dc</h3>\\n> \\n> <ul>\\n> \\t<li><b>\ud480 \uc0ac\uc774\uc988 \ubc31\ub77c\uc774\ud2b8 \ud0a4\ubcf4\ub4dc:</b>\\n> \\t<ul>\\n> \\t\\t<li>\ubc29\ud5a5\ud0a4 4\uac1c\ub97c \ud3ec\ud568\ud55c 64\ud0a4 \ud0a4\ubcf4\ub4dc(ANSI)</li>\\n> \\t\\t<li>Touch ID \uc13c\uc11c\uac00 \ub0b4\uc7a5\ub41c Touch Bar</li>\\n> \\t\\t<li>\uc8fc\ubcc0\uad11 \uc13c\uc11c</li>\\n> \\t\\t<li>\uc815\ud655\ud55c \ucee4\uc11c \uc81c\uc5b4 \ubc0f \uc555\ub825\uac10\uc9c0 \uae30\ub2a5\uc744 \uc704\ud55c Force Touch \ud2b8\ub799\ud328\ub4dc: \uc138\uac8c \ud074\ub9ad, \uac00\uc18d\ub3c4\uacc4, \uc555\ub825\uac10\uc9c0\ub97c \uc774\uc6a9\ud55c \uadf8\ub9ac\uae30, Multi-Touch \uc81c\uc2a4\ucc98 \uc9c0\uc6d0</li>\\n> \\t</ul>\\n> \\t</li>\\n> </ul>\\n> \\n> <h3>\ubb34\uc120 \uae30\uc220</h3>\\n> \\n> <ul>\\n> \\t<li><b>Wi-Fi</b><br/>\\n> \\t802.11ac Wi-Fi \ubb34\uc120 \ub124\ud2b8\uc6cc\ud06c, IEEE 802.11a/b/g/n \ud638\ud658</li>\\n> \\t<li><b>Bluetooth</b><br/>\\n> \\tBluetooth 5.0 \ubb34\uc120 \uae30\uc220</li>\\n> </ul>\\n> \\n> <h3>\uce74\uba54\ub77c</h3>\\n> \\n> <ul>\\n> \\t<li>720p FaceTime HD \uce74\uba54\ub77c</li>\\n> </ul>\\n> \\n> <h3>\ube44\ub514\uc624 \uc9c0\uc6d0</h3>\\n> \\n> <p>\ub0b4\uc7a5\ub41c \ub514\uc2a4\ud50c\ub808\uc774\uc5d0\uc11c \uc218\ubc31\ub9cc \uc0c9\uc0c1\uc73c\ub85c \uae30\ubcf8 \ucd5c\ub300 \ud574\uc0c1\ub3c4\uc640 \ub2e4\uc74c\uc744 \ub3d9\uc2dc \uc9c0\uc6d0:</p>\\n> \\n> <ul>\\n> \\t<li>60Hz\uc5d0\uc11c 10\uc5b5 \uc774\uc0c1\uc758 \uc0c9\uc0c1\uc73c\ub85c 5120 x 2880 \ud574\uc0c1\ub3c4 \ub514\uc2a4\ud50c\ub808\uc774 \ucd5c\ub300 2\ub300 \uc9c0\uc6d0</li>\\n> \\t<li>60Hz\uc5d0\uc11c 10\uc5b5 \uc774\uc0c1\uc758 \uc0c9\uc0c1\uc73c\ub85c 4096 x 2304 \ud574\uc0c1\ub3c4 \ub514\uc2a4\ud50c\ub808\uc774 \ucd5c\ub300 4\ub300 \uc9c0\uc6d0</li>\\n> </ul>\\n> \\n> <p>Thunderbolt 3 \ub514\uc9c0\ud138 \ube44\ub514\uc624 \ucd9c\ub825</p>\\n> \\n> <ul>\\n> \\t<li>USB\u2011C\ub97c \ud1b5\ud55c \uae30\ubcf8 DisplayPort \ucd9c\ub825</li>\\n> \\t<li>\uc5b4\ub311\ud130\ub97c \ud1b5\ud574 VGA, HDMI, DVI, Thunderbolt 2 \ucd9c\ub825 \uc9c0\uc6d0(\uc5b4\ub311\ud130 \ubcc4\ub9e4)</li>\\n> </ul>\\n> \\n> <h3>\uc624\ub514\uc624</h3>\\n> \\n> <ul>\\n> \\t<li>\ub192\uc740 \ub2e4\uc774\ub0b4\ubbf9 \ub808\uc778\uc9c0\uc758 \uc2a4\ud14c\ub808\uc624 \uc2a4\ud53c\ucee4</li>\\n> \\t<li>\ub9c8\uc774\ud06c 3\uac1c</li>\\n> \\t<li>3.5mm \ud5e4\ub4dc\ud3f0 \uc7ad</li>\\n> </ul>\\n> \\n> <h3>\ubc30\ud130\ub9ac \ubc0f \uc804\uc6d0<sup>2</sup></h3>\\n> \\n> <ul>\\n> \\t<li>\ubb34\uc120 \uc778\ud130\ub137 \uc0ac\uc6a9 \ucd5c\ub300 10\uc2dc\uac04</li>\\n> \\t<li>iTunes \ub3d9\uc601\uc0c1 \uc7ac\uc0dd \ucd5c\ub300 10\uc2dc\uac04</li>\\n> \\t<li>\ub300\uae30 \uc2dc\uac04 \ucd5c\ub300 30\uc77c</li>\\n> \\t<li>83.6\uc640\ud2b8\uc2dc \ub9ac\ud2ac \ud3f4\ub9ac\uba38 \ubc30\ud130\ub9ac \ub0b4\uc7a5</li>\\n> \\t<li>87W USB-C \uc804\uc6d0 \uc5b4\ub311\ud130</li>\\n> </ul>\\n> \\n> <h3>\uc0ac\uc6a9 \ud658\uacbd</h3>\\n> \\n> <ul>\\n> \\t<li>\uc804\uc555: 100V ~ 240V AC</li>\\n> \\t<li>\uc8fc\ud30c\uc218: 50Hz ~ 60Hz</li>\\n> \\t<li>\uc791\ub3d9 \uc628\ub3c4: 10\xb0C ~ 35\xb0C</li>\\n> \\t<li>\ubcf4\uad00 \uc628\ub3c4: \u201325\xb0C ~ 45\xb0C</li>\\n> \\t<li>\uc0c1\ub300 \uc2b5\ub3c4: 0% ~ 90% \ubbf8\uc751\uacb0</li>\\n> \\t<li>\uc791\ub3d9 \uace0\ub3c4: 3,000m\uae4c\uc9c0 \ud14c\uc2a4\ud2b8</li>\\n> \\t<li>\ucd5c\ub300 \ubcf4\uad00 \uace0\ub3c4: 4,500m</li>\\n> \\t<li>\ucd5c\ub300 \uc6b4\uc1a1 \uace0\ub3c4: 10,600m</li>\\n> </ul>\\n> \\n> <h3>\ud06c\uae30 \ubc0f \ubb34\uac8c</h3>\\n> \\n> <ul>\\n> \\t<li>\ub450\uaed8: 1.55cm</li>\\n> \\t<li>\uac00\ub85c: 34.93cm</li>\\n> \\t<li>\uc138\ub85c: 24.07cm</li>\\n> \\t<li>\ubb34\uac8c: 1.83kg<sup>3</sup></li>\\n> </ul>\\n> \\n> <h3>\uc6b4\uc601\uccb4\uc81c</h3>\\n> \\n> <p><strong>macOS</strong><br/>\\n> macOS\ub294 Mac\uc774 \ud558\ub294 \ubaa8\ub4e0 \uc77c\ub4e4\uc744 \uac00\ub2a5\ud558\uac8c \ud574\uc8fc\ub294 \uc6b4\uc601\uccb4\uc81c\uc785\ub2c8\ub2e4. macOS Mojave\ub294 \ucd5c\uace0\uc758 Mac \ud30c\uc6cc \uc720\uc800\ub4e4\ub85c\ubd80\ud130 \uc601\uac10\uc744 \ubc1b\uc544, \ubaa8\ub450\uac00 \uc4f0\uae30 \uc88b\uac8c \ub514\uc790\uc778\ub41c \uc0c8\ub85c\uc6b4 \uae30\ub2a5\ub4e4\uc744 \uc120\ubcf4\uc785\ub2c8\ub2e4. \uadf8\ub798\uc11c \ub9e4 \ud074\ub9ad\ub9c8\ub2e4 \ud560 \uc218 \uc788\ub294 \uc77c\uc774 \ub354\ub354\uc6b1 \ub9ce\uc544\uc9c0\uc8e0.<br/>\\n> <a href=\\"https://support.apple.com/ko-kr/macos\\" onclick=\\"s_objectID=\'https://support.apple.com/ko-kr/macos_1\';return this.s_oc?this.s_oc(e):true\\">\ub354 \uc54c\uc544\ubcf4\uae30</a><a href=\\"http://support.apple.com/ko-kr/macos\\" onclick=\\"s_objectID=\'http://support.apple.com/ko-kr/macos_1\';return this.s_oc?this.s_oc(e):true\\">&nbsp;-&nbsp;\uc6b4\uc601\uccb4\uc81c</a></p>\\n> \\n> *\ucd9c\ucc98 : Apple \uacf5\uc2dd \ud648\ud398\uc774\uc9c0 [[\ub9c1\ud06c](https://support.apple.com/kb/SP776?locale=ko_KR)]*\\n\\n\ud544\uc790\ub294 \uae30\ubcf8\ud615\uc5d0\uc11c \ud504\ub85c\uc138\uc11c\uc640 \uadf8\ub798\ud53d, \uc800\uc7a5 \uc7a5\uce58\uc5d0 \uc870\uae08 \ub354 \ud22c\uc790\ud558\uc5ec i7 \ud504\ub85c\uc138\uc11c, 500GB \uc2a4\ud1a0\ub9ac\uc9c0, 2.6GHz Radeon Pro 560X\uac00 \ud0d1\uc7ac\ub418\uc5c8\ub2e4.  \\n\uc2a4\ud399\uc744 \ubcf4\uba74 \ub2e4\ub978 \uace0\uc131\ub2a5 \ub7a9\ud0d1\uacfc \ube44\uad50\ud574\ub3c4 \uc190\uc0c9\uc5c6\uc744 \uc815\ub3c4\ub85c \uc131\ub2a5\uc774 \ub6f0\uc5b4\ub098\ub2e4. \uc2e4\uc81c\ub85c \uac1c\ubc1c\uc790\uc778 \ud544\uc790\ub294 \uc8fc\ub85c IDE (intellij)\ub97c \ub9ce\uc774 \uc0ac\uc6a9\ud558\ub294\ub370, \ub9e5\ubd81 \uc774\uc804\uc758, \uadf8\ub7a8\uc744 \uc0ac\uc6a9\ud560\ub54c \ubcf4\ub2e4 \ub354 \ucf8c\uc801\ud568\uc744 \ub290\ub084\uc218 \uc788\uc5c8\ub2e4. \\n\\n## 2. \ub514\uc790\uc778\\n\ud544\uc790\uc758 \ub9e5\ubd81\uc740 \uc2a4\ud398\uc774\uc2a4 \uadf8\ub808\uc774\uc774\ub2e4. \uc560\ud50c\uc774 \uc790\ub791\ud558\ub294 \uc720\ub2c8\ubc14\ub514\uc758 \uae54\ub054\ud55c \ubaa8\uc2b5\uacfc \uc644\uc131\ub3c4 \ub192\uc740 \ub9c8\uac10\uc774 \uad49\uc7a5\ud788 \ub9cc\uc871\uc2a4\ub7fd\ub2e4.\\n![\uc804\uccb4 \uc774\ubbf8\uc9c0](./macbook-pro/IMG_0081.png)\\n![\ud0a4\ubcf4\ub4dc \uc774\ubbf8\uc9c0.](./macbook-pro/IMG_0082.png)\\n\ub098\ube44\uc2dd \ud0a4\ubcf4\ub4dc\ub97c \ucc44\uc6a9\ud574 \uc9c4\ubcf4\ub41c \ud0a4\uac10\uc744 \uc120\uc0ac\ud55c\ub2e4\uace0 \ud558\uc9c0\ub9cc... \uae00\uc384...\\n![\uc0c1\ud310 \uc774\ubbf8\uc9c0](./macbook-pro/IMG_0086.png)\\n\uc774\uc804 \ubaa8\ub378\uacfc\ub294 \ub2e4\ub974\uac8c \uc560\ud50c \ub85c\uace0\uac00 \ube5b\ub098\uc9c0 \uc54a\ub294\ub2e4.\\n![\uc88c\uce21\uba74 \uc774\ubbf8\uc9c0](./macbook-pro/IMG_0087.png)\\n\ubcf8\uccb4\uc758 \uc88c\uce21\uba74\uc5d0\ub294 \uc36c\ub354\ubcfc\ud2b83 \ud3ec\ud2b8<br/> \ub2e8 2\uac1c\ub9cc \ubc30\uce58\ub418\uc5b4\uc788\ub2e4. \\n![\uc6b0\uce21\uba74 \uc774\ubbf8\uc9c0](./macbook-pro/IMG_0088.png)\\n\ubcf8\uccb4\uc758 \uc6b0\uce21\uba74\uc5d0\ub294 \uc36c\ub354\ubcfc\ud2b83 \ud3ec\ud2b8 2\uac1c\uc640<br/> 3.5mm \uc774\uc5b4\ud3f0 \uc7ad\uc774 \ubc30\uce58\ub418\uc5b4\uc788\ub2e4.\\n\\n## \uc7a5\uc810\\n\ub9e5\ubd81\uc744 \uc4f0\uba74\uc11c \uac00\uc7a5 \ud06c\uac8c \uc640\ub2ff\ub294 \uc7a5\uc810\uc740 \uc5ed\uc2dc OS\uc640 \ud558\ub4dc\uc6e8\uc5b4\uc758 \uc218\uc900\ub192\uc740 \uc870\ud654\uac00 \uc544\ub2d0\uae4c \uc0dd\uac01\ud55c\ub2e4. \uad6c\ub9e4 \ub2f9\uc2dc\uc758 OS\ub294 \ubaa8\ud558\ube44\ub85c \uc774\ub54c \ub2f9\uc2dc\uc5d0\ub3c4 \ub9cc\uc871\uc2a4\ub7ec\uc6b4 \uc131\ub2a5\uacfc \ubbf8\ub824\ud55c UI\ub97c \uc81c\uacf5\ud574  \\n\uc560\ud50c \ud2b9\uc720\uc758 \uac10\uc131(?)\uc744 \ub290\ub07c\uae30\uc5d0 \ucda9\ubd84\ud588\uace0, \uc131\ub2a5\uc0c1\uc758 \ubd88\ud3b8\ub3c4 \uc804\ud600 \uacaa\uc744 \uc218 \uc5c6\uc5c8\ub2e4. \uc704\uc5d0 \uc5b8\uae09\ud588\ub4ef, eclipse\ub9cc \ub3cc\ub824\ub3c4 \ud798\ub4e4\uc5b4\ud558\ub358 \uadf8\ub7a8\uc5d0 \ube44\ud574 xcode, intellij, android studio\ub97c \ub3d9\uc2dc\uc5d0 \uc0ac\uc6a9\ud568\uc5d0\ub3c4  \\n\ud070 \ubb34\ub9ac\uac00 \uc5c6\uc5c8\ub2e4. \\n\\n\uc560\ud50c \ub2e4\uc6b4 \uc644\uc131\ub3c4 \ub192\uc740 \ub9c8\uac10 \ub610\ud55c, \ub192\uc740 \uac00\uaca9\uc744 \uc778\uc815\ud558\uac8c \ub9cc\ub4dc\ub294 \uc694\uc18c \uc911 \ud558\ub098\uc77c \uac83\uc774\ub2e4. \ub9e4\ub044\ub7fd\uac8c \uc9dc\uc778 \uc720\ub2c8\ubc14\ub514\ub294 \uacac\uace0\ud568\uc744 \ub354\ud574 \uc644\uc131\ub3c4\ub97c \ub354\uc6b1 \ub192\uc5ec \uc9c0\ub8e8\ud558\uc9c0 \uc54a\uace0 \uc0ac\uc6a9\ud558\ub294 \ub3d9\uc548  \\n\ud2b9\ubcc4\ud55c \uc0ac\ub78c\uc774\ub41c \uac83 \uac19\uc740 \ub290\ub08c\uc744 \ubc1b\uac8c\ud55c\ub2e4. \\n\\n\ucd5c\uadfc \ub4e4\uc5b4\uc11c\ub294 \uc8fc\ubcc0 \uc804\uc790\uae30\uae30\ub97c \uc560\ud50c \uc0dd\ud0dc\uacc4\ub85c \uc804\ud658\ud558\uba74\uc11c \ub9e5\ubd81\uc744 \uc0ac\uc6a9\ud558\ub294 \ub9cc\uc871\uac10\uc774 \ub354\uc6b1 \ud06c\uac8c \uc640\ub2ff\uc558\ub2e4.  \\n\uc560\ud50c \uc81c\ud488\uac04\uc758 \ud578\ub4dc\uc624\ud504\ub294 \ud070 \uc9c0\uc5f0 \uc5c6\uc774 \uc790\uc5f0\uc2a4\ub7fd\uac8c \uc774\ub904\uc838 \ub0b4\uac00 \ud558\ub294 \uc791\uc5c5\uc744 \uc560\ud50c \uae30\uae30 \uc5b4\ub514\uc11c\ub098 \ub04a\uae40\uc5c6\uc774 \uc774\uc5b4\ub098\uac08 \uc218 \uc788\uac8c \ud55c\ub2e4.\\n\\n## \ub2e8\uc810\\n\uac00\uaca9\uc774 \uac00\uc7a5 \ud070 \ub2e8\uc810\uc774 \uc544\ub2d0\uae4c \uc0dd\uac01\ub41c\ub2e4. \ud544\uc790\ub294 \uad6c\ub9e4 \ub2f9\uc2dc 300\ub9cc\uc6d0 \uac00\ub7c9\uc744 \uc9c0\ubd88\ud588\ub2e4. \uc0ac\ud68c \ucd08\ub144\uc0dd, \ud559\uc0dd\uc5d0\uac8c\ub294 \uac10\ub2f9\ud558\uae30 \ud798\ub4e0 \uae08\uc561\uc784\uc5d4 \ubd84\uba85\ud558\ub2e4.  \\n\\n\ub610\ud55c \ubb34\uac8c\uac00 \ub9cc\ub9cc\uce58 \uc54a\ub2e4. \uacf5\uc2dd \ubb34\uac8c\ub85c\ub294 1.83kg\uc73c\ub85c \uc774\ubbf8 \uc5ec\ud0c0 \uac8c\uc774\ubc0d \ub7a9\ud0d1\uc758 \ubb34\uac8c\uc640 \ube44\uc2b7\ud558\uba70, \ud30c\uc6cc\ube0c\ub9ad\uc744 \ud3ec\ud568\ud558\uba74 2kg \uc744 \ub118\uc5b4 \ud734\ub300\ud558\uae30\uc5d4 \ubd80\ub2f4\uc2a4\ub7ec\uc6b4 \ubb34\uac8c\uc774\ub2e4.  \\n\ub9cc\uc57d \ubcf8\uc778\uc774 \ud559\uc0dd\uc774\uace0, \ub9e5\ubd81\uc744 \ub4e4\uace0 \uc6c0\uc9c1\uc774\ub294 \uacbd\uc6b0\uac00 \ub9ce\uac70\ub098 \uadf8\ub7f0 \uc2dc\uac04\uc774 \uae38\ub2e4\uba74 Macbook Air\ub098 \ub2e4\ub978 \uacbd\ub7c9 \ub7a9\ud0d1\uc744 \ucd94\ucc9c\ud55c\ub2e4.  \\n\\n\uc8fc\ubcc0 \uc804\uc790\uae30\uae30\uac00 \uc560\ud50c \uc0dd\ud0dc\uacc4\uac00 \uc544\ub2cc \uacbd\uc6b0\uc5d0\ub3c4 \ucd94\ucc9c\ud558\uc9c0 \uc54a\ub294\ub2e4. \ube44\uc2fc \uae08\uc561 \ub4e4\uc5ec \ub9c8\ub828\ud55c \ub7a9\ud0d1\uc5d0 \ub0b4\uac00 \uc0ac\uc6a9\ud560 \uc218 \uc5c6\ub294 \uae30\ub2a5\uc774 \uc788\ub2e4\uba74 \uc2ec\uc801\uc73c\ub85c\ub3c4  \uc548\ud0c0\uae4c\uc6b8 \uac83\uc774\ub2e4.\\n\\n## \uc815\ub9ac\\n\uc5ec\ud0c0 \ub7a9\ud0d1\uacfc\ub294 \ud655\uc2e4\ud788 \ub2e4\ub978 \uc644\uc131\ub3c4\ub97c \ubcf4\uc5ec\uc8fc\ub294 \ub9e5\ubd81 \ud504\ub85c\uc600\ub2e4. \uc791\uc5c5\uc6a9 \ub7a9\ud0d1, \uc0ac\ubb34\uc2e4\uc5d0 \ub450\uace0 \uc6c0\uc9c1\uc77c \uc77c\uc774 \uc801\ub2e4\uba74 \ucda9\ubd84\ud788 \uace0\ub824\ud574\ubcfc \ub9cc \ud558\ub2e4 \uc0dd\uac01\ub41c\ub2e4.  \\n\ub2e4\ub9cc, \ubcf8\uc778\uc774 \ud559\uc0dd\uc774\uc5b4\uc11c \ub4e4\uace0 \uc6c0\uc9c1\uc5ec\uc57c \ud558\ub294 \uacbd\uc6b0\uac00 \ub9ce\ub2e4\uba74, \ub2e4\ub978 \uc120\ud0dd\uc9c0\ub97c \uace0\ub974\uae30\ub97c \ucd94\ucc9c\ud55c\ub2e4. \ud655\uc2e4\ud788 \ubb34\uac81\uace0, \ucd9c\ud1f4\uadfc 3\uc2dc\uac04 (\ud3b8\ub3c4 1\uc2dc\uac04 30\ubd84)\uc744 \ub4f1\uc5d0 \uba54\uace0 \uc788\ub294 \uac83\uc774 \uaf64\ub098 \uccb4\ub825 \uc18c\ubaa8\uac00 \uc788\ub2e4.  \\n\uadf8\ub7ec\ub098 \uad6c\ub9e4\ud6c4\uc758 \ub9cc\uc871\uac10\uc740 \ud655\uc2e4\ud558\ub2e4 \uc0dd\uac01\ub41c\ub2e4. \uc5b4\ub5a4 \uc791\uc5c5\uc744 \ud558\ub358 \ubd88\ud3b8\uc744 \ub290\ub084 \ubd80\ubd84\uc740 \uc5c6\uc5c8\uc73c\uba70 2\ub144\uc774 \ub41c \ud604\uc7ac\ub3c4 \ucda9\ubd84\ud788 \uacc4\uc18d \uc0ac\uc6a9\ud560 \uc218 \uc788\uc744\uac83\uac19\ub2e4.\\n\\n\\nimport CoupangPartners from \'@site/src/components/coupang-partners\'\\n\\n<CoupangPartners\\n    adID=\\"527409\\"\\n    template=\\"carousel\\"\\n    trackingCode=\\"AF8809335\\"\\n    width={680}\\n    height={140}\\n/>"}]}')}}]);